DROP TABLE IF EXISTS fabric;

CREATE TABLE `fabric` (
  `id` bigint(10) unsigned NOT NULL AUTO_INCREMENT,
  `dcm_SeriesInstanceUID` varchar(250) DEFAULT NULL,
  `time_stamp` bigint(20) unsigned DEFAULT NULL,
  `dcm_index` bigint(10) unsigned DEFAULT NULL,
  `fabric` varchar(20000) DEFAULT NULL,
  `fab_width` bigint(10) unsigned DEFAULT NULL,
  `fab_height` bigint(10) unsigned DEFAULT NULL,
  `user` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=524 DEFAULT CHARSET=utf8;




